  createStyles({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(24),
      textAlign: "center",
      color: theme.palette.text.secondary,
    },
  })
);

function Projects() {
  const classes = useStyles();

  return (
    <>
      <Barrinha />
      {/* <Footer /> */}
    </>
  );
}

export default Projects;
